import React from 'react';
import {useLocalStorage} from './ReactCoding/Memorization.jsx';
const SearchBar = ({inputText, isStockedOnly, onFilterTextChange, onStockValueChane}) => {
    const localData = useLocalStorage('searchText', inputText);
    return (
    <form>
      <input 
        type="text" 
        value={inputText} placeholder="Search..." 
        onChange={(e) => onFilterTextChange(e.target.value)} />
      <label>
        <input 
          type="checkbox" 
          checked={isStockedOnly} 
          onChange={(e) => onStockValueChane(e.target.checked)} />
        {' '}
        Only show products in stock
      </label>
      {localData.data && <div>Local Storage Data: {localData.data}</div>}
    </form>
  );
};

export default SearchBar;
